What I like to call finishing touches after I’m pretty much resdy to go. I love a good body glow + bronze and for my scents I prefer light but masculine, if that makes sense 😜 

@tingebeauty body tint is one of my faves for adding a golden glow to my legs or arms & chest. It’s transfer proof but because I like to mix it with body oil or lotion I also spray an aerosol deodorant to set it (this trick works soo well! It’s like a setting spray for your body..just let the product dry then spritz and let that dry) The brush I’m using is my favorite for the body it smooths all products out nicely & evenly. You can’t get a sense for the finish here that well but I have a body makeup highlight that shows how well this stuff covers bruises, cuts & just makes your skin look flawless 

@boy__smells woodphoria is so up my alley. It’s woodsy and has a tiny spice to it but it’s feminine too. I love scents that linger but are not overpowering. Ones that almost smell like you used a body wash and then it just lasted on your skin for hours. This is like that. For reference my other faves are @officialbyredo Mojave ghost @narsissist audacious & @narciso_rodriguez for her

